import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import Tilt from "./vanilla-tilt.js";
import Typed from "typed.js";
import "./App.css";
import "./script.js";
function App() {
  useEffect(() => {
    AOS.init();
    Tilt.init(document.querySelectorAll(".tilt"));

    // Clean up Tilt on component unmount
    return () => {
      Tilt.destroy();
    };
  }, []);

  // Initialize Typed.js when the component mounts
  useEffect(() => {
    const options = {
      strings: ["Your first string", "Your second string"],
      typeSpeed: 50,
      backSpeed: 50,
      loop: true,
    };

    const typed = new Typed(".auto-type", options);

    // Clean up Typed.js on component unmount
    return () => {
      typed.destroy();
    };
  }, []);

  return (
    <div>
      {/* ========== SIDEBAR ========== */}
      <div className="nav_toggle" id="nav-toggle">
        <i className="uil uil-bars"></i>
      </div>

      <aside className="sidebar" id="sidebar">
        <nav className="nav">
          <div className="nav_menu">
            <div className="menu">
              <ul className="nav_list">
                <li className="nav_item">
                  <a href="#home" className="nav_link">
                    Home
                  </a>
                </li>
                <li className="nav_item">
                  <a href="#about" className="nav_link">
                    Hobby
                  </a>
                </li>
                {/* Add other navigation items */}
              </ul>
            </div>
          </div>

          <div className="nav_close" id="nav-close">
            <i className="uil uil-multiply"></i>
          </div>
        </nav>
      </aside>

      {/* ========== MAIN ========== */}
      <main className="main">
        {/* ===== Home ===== */}
        <section className="home" id="home">
          <div className="home_container container grid">
            <div
              className="home_data"
              data-aos="fade-right"
              data-aos-delay="200"
            >
              <p className="home_hey">Hey There,</p>
              <h1 className="home_name">
                I'm <span>Christian Montero and Albert Retiza</span>
              </h1>
              <h3 className="home_student">
                a <span className="auto-type"></span>
              </h3>
              <a
                href="#about"
                className="button"
                data-aos="zoom-in"
                data-aos-delay="600"
              >
                More About Us{" "}
                <i className="uil uil-chat-bubble-user button_icon"></i>
              </a>
            </div>
          </div>
        </section>

        {/* ===== HOBBY ===== */}
        <section className="montero-hobby" id="about">
          <div className="inner-width">
            {/* ... (Content for the Hobby section) */}
          </div>
        </section>

        {/* ... (Repeat for other sections like Movies, Interest, Contact, and Footer) */}

        {/* ========== FOOTER ========== */}
        <footer>
          <div className="footer-contnt">
            {/* ... (Content for the Footer section) */}
          </div>
        </footer>
      </main>
    </div>
  );
}

export default App;
